Get_AccountIDs_for_Number_of_Cases_1.query:
q = load "${App.Datasets.RBDemoCase.FullyQualifiedName}";
q = filter q by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in {{row(Period_Selector_Static_3.selection, [0] ,["value"]).asObject()}};
q = group q by 'ACCOUNTID';
q = foreach q generate 'ACCOUNTID' as 'ACCOUNTID', number_to_string(count(), "#") as 'case_count', count() as 'count';
q = filter q by 'case_count' == "{{cell(Number_of_Cases_1.selection,0,"# Cases Created").asObject()}}";
q = limit q 2000;

Number_of_Cases_1.query:
q = load "${App.Datasets.RBDemoCase.FullyQualifiedName}";
q = filter q by {{column(Get_AccountIDs_for_Customers_Withdrawing_Money_1.result, ["ACCOUNTID"]).asEquality('ACCOUNTID')}};
q = filter q by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in {{row(Period_Selector_Static_3.selection, [0] ,["value"]).asObject()}};
q = group q by 'ACCOUNTID';
q = foreach q generate 'ACCOUNTID' as 'ACCOUNTID', number_to_string(count(), "#") as 'case_count', count() as 'count';
q = group q by 'case_count';
q = foreach q generate 'case_count' as '# Cases Created', unique('ACCOUNTID') as '# of Customers', min('count') as 'sort';
q = order q by 'sort' asc;
q = limit q 2000;

Financial_Account_Details_Static_1.query:
q = load "${App.Datasets.RBDemoFinancialAccount.FullyQualifiedName}";
