Get_AccountIDs_for_Customers_Withdrawing.query:
q = load "${App.Datasets.RBDemoFinancialAccountTransaction.FullyQualifiedName}";
q = filter q by 'TRANSACTIONTYPE' == "Debit";
q = filter q by 'TRANSACTIONSTATUS' == "Posted";
q = filter q by date('TRANSACTIONDATE_Year', 'TRANSACTIONDATE_Month', 'TRANSACTIONDATE_Day') in {{row(Period_Selector_Static_1.selection, [0] ,["value"]).asObject()}};
q = group q by 'ACCOUNTID';
q = foreach q generate 'ACCOUNTID' as 'ACCOUNTID', sum('AMOUNT') as 'sum_AMOUNT', case when sum('AMOUNT') < 10000 then "1.Less than $10k" when sum('AMOUNT') <= 25000 then "2.$11k-25K" when sum('AMOUNT') <= 50000 then "3.$26k-50k" when sum('AMOUNT') <= 100000 then "4.$51k-100k" else "5.More than $100k" end as 'Amount_Range';
q = filter q by 'Amount_Range' == "{{cell(Customers_Withdrawing_Money_1.selection,0,"Amount Withdrawn").asObject()}}";
q = limit q 2000;

